import java.util.Scanner;


public class Numero5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	    Scanner entrada = new Scanner(System.in);
	    
	    for (int num = 0; num <= 20; num++) {
	    	System.out.println(num);
	    }
	    
	    int num = 0;
	    
	    while (num <= 20) {
	    	System.out.println(num); 
	    	num = num + 1;	
	}
entrada.close();
}
}
